DROP DATABASE IF EXISTS Eproject;

CREATE DATABASE IF NOT EXISTS Eproject;
USE Eproject;


DROP TABLE IF EXISTS manufacturer;

CREATE TABLE manufacturer(
   id   VARCHAR(30) NOT NULL PRIMARY KEY
  ,name       VARCHAR(97)
);


DROP TABLE IF EXISTS catetory;

CREATE TABLE IF NOT EXISTS category(
    id           INT PRIMARY KEY
    ,name             VARCHAR(100)                    
);



DROP TABLE IF EXISTS `condition`;
CREATE TABLE IF NOT EXISTS `condition`(
    id         INT PRIMARY KEY
    ,name      VARCHAR(100)
);






DROP TABLE IF EXISTS Products;

CREATE TABLE IF NOT EXISTS Products(
   id                    VARCHAR(20) NOT NULL PRIMARY KEY
  ,name                  VARCHAR(193) NOT NULL
  ,manufacturer_id    VARCHAR(30) NOT NULL
  ,category_id         INT NOT NULL
  ,created_at             DATE  NOT NULL
  ,updated_at           DATE  NOT NULL
  ,price    NUMERIC(7,2) NOT NULL
  ,condition_id    INT NOT NULL
  ,currency     VARCHAR(3) NOT NULL
  ,image_url             TEXT NOT NULL
  ,availability VARCHAR(15) NOT NULL
  ,on_sale       VARCHAR(5) NOT NULL
  ,KEY `manufacturer_id` (`manufacturer_id`)
  ,KEY `category_id` (`category_id`)
  ,KEY `condition_id` (`condition_id`)
  ,CONSTRAINT `Products_ibfk_3` FOREIGN KEY (`condition_id`) REFERENCES `condition` (`id`)
  ,CONSTRAINT `Products_ibfk_2` FOREIGN KEY (`category_id`) REFERENCES `category` (`id`)
  ,CONSTRAINT `Products_ibfk_1` FOREIGN KEY (`manufacturer_id`) REFERENCES `manufacturer` (`id`)
);





